684	5	6_0	{"question":"这款袜子的材质特点是什么？","answer":"它采用了优质的新疆长绒棉，这种棉花以纤维长、质地柔软而闻名，被誉为“棉中极品”。相比于普通的棉花，长绒棉更加细腻，触感更为丝滑，能够给你的双脚带来极致的舒适体验。而且，这款袜子的面料中还含有一定比例的涤纶和氨纶，这使得袜子既有良好的弹性，又能保持形状，不易变形。","link_id":"六号链接"}	[-0.0479084,0.0488681,-0.06771668,0.0056718476,-0.049482312,-0.017591365,0.013330282,0.08621976,-0.053321127,0.06080681,-0.015259285,0.07954022,0.021862045,-0.022994496,0.07489526,0.013598998,-0.01786968,-0.051632047,0.02669895,-0.034510937,-0.057850927,0.021804463,-0.057505433,-0.013186325,0.018493487,0.062380727,-0.00029495885,0.036545508,0.06794701,-0.0100289015,0.024491632,0.0990414,0.06598921,-0.03514434,-0.0025672067,-0.057044774,0.015940676,-0.018531874,-0.05942484,0.027082833,0.013589401,0.021305418,-0.017073125,0.007596053,0.015153718,-0.057697374,0.006799499,-0.048445832,-0.009054802,-0.026430234,-0.002378865,-0.009621027,0.0022097172,-0.04967425,0.035489835,0.034223028,0.0013963686,-0.032668307,-0.0016986751,-0.017399425,-0.05182399,0.029770002,0.042150177,-0.02669895,0.0057390267,0.024683574,0.021401387,-0.00547031,-0.035816133,-0.009942528,-0.0030542563,0.03867605,-0.03262992,0.038100228,-0.053551454,-0.03660309,-0.02495229,-0.004858499,0.026583787,0.038484108,0.059578393,0.006252468,0.030691316,0.018541472,-0.046987083,-0.011852338,0.002146137,-0.018378321,-0.0008955233,-0.023339989,-0.016593274,-0.038004257,0.0023956597,-0.041113697,0.037716348,0.040729817,0.0077879936,-0.0035125148,0.06710247,0.018455097,0.0028959052,0.01627657,0.004421834,-0.0660276,0.03418464,0.005657452,-0.011919517,0.04579705,0.022457061,-0.0023044879,0.055125367,0.04042271,0.0019541963,-0.010307215,-0.030921645,-0.021343805,-0.026430234,-0.05282208,0.0009249142,-0.038503304,0.013503028,-0.0035485036,-0.040998533,-0.0029798793,0.026238292,-0.02938612,-0.014011671,0.04234212,-0.0398085,0.021247836,0.022744972,0.04579705,-0.01702514,0.0020561647,-0.06168974,-0.024606798,-0.050058134,0.07769759,0.031631827,-0.040768202,0.07328296,0.031497467,-0.039347842,-0.037505213,-0.0006891871,-0.015