661	5	3_4	{"question":"梳子的其他特点有哪些？","answer":"首先，它采用了镂空速干设计，受热均匀，能够快速造型，定型更快。梳子的材质是ABS，耐用且轻便，梳子的重量大约是85克，非常轻巧，方便携带。梳子的外观设计也很人性化。它有弯月弧的设计，更贴合头部的曲线，梳发时更加流畅。梳子的底部是立式的底座，可以方便地放置在桌面上，而且还有挂钩设计，可以挂在墙上或者浴室的挂钩上，节省空间。颜色方面，有粉、绿、蓝三种选择，每种颜色都十分清新，符合现代审美。如果你喜欢粉色，可以选择粉色的梳子，它会给你带来一种冰激凌般的甜蜜感觉。此外，这款梳子还配备了OPP袋包装，既环保又卫生。包装简洁大方，非常适合送人或者自用。","link_id":"三号链接"}	[-0.03209199,0.040648572,-0.044532683,-0.027227238,0.002735222,0.013286738,-0.01935326,0.07637471,0.006369366,0.0546083,0.051301036,0.06964481,-0.001976907,-0.027784856,0.06518385,0.053954538,-0.034226328,-0.04714773,0.02820788,-0.0040331306,-0.009436276,0.03999481,-0.05472367,0.0660299,0.0017017024,0.05695415,-0.06483774,-0.02363155,0.006802002,-0.053223863,-0.006287646,0.03820658,0.029938424,-0.023285441,-0.036649093,-0.073567376,0.0012426273,0.0040547624,-0.061145913,0.005951151,0.0009013254,0.026458105,0.02718878,-0.014873071,0.049493577,-0.045609467,0.006926986,-0.036302984,0.024612192,-0.077297665,0.016132522,0.012546449,0.011623492,-0.09598755,0.001770203,0.063684046,0.0031294017,-0.04091777,-0.009037289,0.0058453954,-0.06041524,0.05760791,-0.012133041,-0.033726394,0.002286963,0.050954927,-0.040533204,-0.004388854,-0.0055185147,-0.011719634,0.0018314931,0.011546579,-0.021651037,0.03378408,-0.07929741,-0.040187094,-0.015171109,0.01972821,-0.032130446,0.004016306,0.058530867,-0.0047830334,0.026938813,0.0018447126,-0.027996369,0.0110947145,-0.021574125,0.009667015,0.021362614,-0.008936341,-0.021824092,0.05214708,-0.027015725,-0.049570493,-0.009941018,0.0277464,0.022381712,-0.04264831,0.036264528,-0.006028064,-0.020824222,0.01705548,0.0017089129,-0.017007409,-0.0027712751,-0.07322127,0.0034683,0.030303761,0.0057107974,-0.0041725356,0.039764073,0.068068095,-0.017324675,-0.00025432397,-0.011469666,-0.025881257,0.0009740323,-0.002208848,-0.008869042,0.021920234,-0.0380143,0.041494615,0.021343386,-0.007845136,-0.005720412,-0.051531777,-0.017363133,0.08014345,-0.020574253,0.025515921,0.038398866,-0.012882944,-0.018766796,0.011267769,-0